export default function App() {
  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif", backgroundColor: "#f9f9f9", minHeight: "100vh" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>ContentGuard Pro</h1>
      <ContentCheckPanel />
      <SlugGenerator />
      <SitemapGenerator />
    </div>
  );
}
